import React from 'react';
import { Card, CardImg, CardText, CardBody, CardTitle, CardSubtitle, Button } from 'reactstrap';

const Pitch = (props) => {
  return (
    <div>
      <Card>
        <CardBody>
          <CardImg src={elevator.png}></CardImg>
          <CardTitle>Idea owner: example@company_email.com</CardTitle>
          <CardSubtitle>Category</CardSubtitle>
          <CardText>My idea is...</CardText>
          <CardText>The resources, I would need to realize my idea, are...</CardText>
          <Button color ='success'>Offer Sponsorship</Button>
        </CardBody>
      </Card>
    </div>
  );
};

export default Pitch;
